Description:
Data Analyst 
Brisbane - Pinkenba
About us 
Airbus in Australia Pacific is a leading aeronautical business employing more than 1500 people across 15 Sites in Australia and New Zealand.
At Airbus you will be encouraged to think bigger. We are driven by our vision which is to be our customers' trusted partner to fly, succeed, and to come back safely every time. We celebrate diversity of thought and we are committed to fostering a culture where our people are supported, our teams have the space and tools to be creative and have the courage to challenge the norm.
The opportunity
We are currently looking for a passionate and curious Data Analyst / Scientist who will contribute to the transformation of the Data Analytics capabilities of Airbus Australia Pacific. Reporting to the Digital Transformation Manager you will be responsible for the end-to-end delivery of Data Analytics projects from understanding the customers' needs, investigating data, methodologies, and technologies through data wrangling and the validation of assumptions to the final presentation and delivery. As the Digital Transformation environment is fast-paced, complex and constantly evolving we need highly flexible and resilient individuals with a passion for constant learning and diverse skillsets
About you
To be successful in this role, it is a requirement to be able to work in a team environment, have well developed relationship skills as well as good verbal and written skills. You will need to be someone who is able to work autonomously and to tight deadlines and work comfortably in a continuous improvement work environment. The skills and experience best suited to this role:

A passion for telling a story using insights from data;
Intellectual curiosity, attention to detail, and ability to rapidly learn new tools and techniques to suit the problem at hand;
Experience querying relational databases and performing analytics;
Proficient in one or more of the following languages/environments: R, Python, Java, SAS, SQL;
Experience with big data platforms (i.e.: Cloudera) and related functionalities for data analytics;
Data visualization skills (Tableau, Plotly, Qlik or similar) and understanding of UI technologies (Shiny, Angular or similar).
Experience capturing business requirements and turning them into actionable development items;
Flexible and adaptable, adept at multi-tasking;
Ability to communicate and collaborate with technical and non-technical colleagues; 
The ability to present complex content to different stakeholders across all organizational levels

Why us
We seek to inspire our people to grow, so you have the right mindset, behaviours and skills to thrive and achieve the organisation goals whilst being focussed on your personal development through classroom and online learning.  
We value the health and wellbeing of our employees and offer true flexibility that allows you to balance your career with what is important to you outside of work.  We will celebrate your successes and achievements with a formal reward and recognition program.
Female applicants are encouraged to apply.
 
If it sounds like a role for you apply now! 
Applications close Sunday 17 July 2022
Applications must include a resume & cover letter. Applicants must be eligible to work in New Zealand and be able to obtain and maintain defence site clearance and have the capacity to satisfy pre-employment medical screening which may include drug and alcohol testing.
